export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},iYh5twyV7G:{data:{id:968,attributes:{imdbId:"tt0092965",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmQwNzczZDItNmI0OS00MjRmLTliYWItZWIyMjk1MTU4ZTQ4L2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"75%"},{Source:"Metacritic",Value:"62\u002F100"}],item_lang:{data:{id:1631,attributes:{title:c,plot:"Based on J. G. Ballard's autobiographical novel, tells the story of a boy, James Graham, whose privileged life is upturned by the Japanese invasion of Shanghai, December 8, 1941. Separated from his parents, he is eventually captured, and taken to Soo Chow confinement camp, next to a captured Chinese airfield. Amidst the sickness and food shortages in the camp, Jim attempts to reconstruct his former life, all the while bringing spirit and dignity to those around him.",slug:"empire-of-the-sun"}}},books:{data:[{id:5727,attributes:{title:c,description:"A young boy living in China at the outbreak of World War II is separated from his wealthy parents, forced to forage for survival in Shanghai's foreign quarter, interned in a Japanese prison camp, and, eventually, reunited with his family, in a new edition of the award-winning autobiographical novel. Reprint. 10,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Nn16PW04GEIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:true,published:"2005-03-07",publisher:h,subtitle:a}},{id:5728,attributes:{title:c,description:"The classic, award-winning novel, made famous by Steven Spielberg's film, tells of a young boy's struggle to survive World War II in China. Jim is separated from his parents in a world at war. To survive, he must find a strength greater than all the events that surround him. Shanghai, 1941 -- a city aflame from the fateful torch of Pearl Harbor. In streets full of chaos and corpses, a young British boy searches in vain for his parents. Imprisoned in a Japanese concentration camp, he is witness to the fierce white flash of Nagasaki, as the bomb bellows the end of the war...and the dawn of a blighted world. Ballard's enduring novel of war and deprivation, internment camps and death marches, and starvation and survival is an honest coming-of-age tale set in a world thrown utterly out of joint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kyN64HCZ5QYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2013-03-19",publisher:h,subtitle:a}},{id:5729,attributes:{title:"The Best Short Stories of J. G. Ballard",description:"First published in 1978, this collection of nineteen of J. G. Ballard's best short stories is as timely and informed as ever. His tales of the human psyche and its relationship to nature and technology, as viewed through a strong microscope, were eerily prescient and now provide greater perspective on our computer-dominated culture. Ballard's voice and vision have long served as a font of inspiration for today's cyber-punks, the authors and futurists who brought the information age into the mainstream.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7WjfAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2014-07-15",publisher:"Holt Paperbacks",subtitle:a}},{id:5730,attributes:{title:"Empire of the Sun [and] The Kindness of Women",description:"Duos.",thumbnail:a,authors:[d],firstBook:e,published:"2006-01-01",publisher:a,subtitle:a}},{id:5731,attributes:{title:c,description:"These study notes on Empire of the Sun were written by Arthur Roberts and are suitable for any course of study which includes this literary text. The study notes include detailed chapter summaries, study questions, character studies, notes on themes, language and interpretation, suggestions for creative tasks and sample examination questions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=le4ZMwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["J G Ballard","Arthur Roberts"],firstBook:e,published:"2012-11-08",publisher:"Ek Press",subtitle:"Passport Study Notes"}}]}}},meta:{}}},prerenderedAt:1681703550607}}("","movie","Empire of the Sun","J. G. Ballard",null,"series",1,"Simon and Schuster"))